  false,\n\t\"url\": null,\n\t\"notes\": \"The 1988 Spitak Earthquake database is
  an extensive collection of geophysical and geological data, maps, charts, images
  and descriptive text pertaining to the catastrophic earthquake in Armenia. This
  earthquake was unique both in catastrophic effects and in study coverage. Research
  groups from the former U.S.S.R., U.S.A., France, and Japan studied the earthquake
  area. The database was developed as a cooperative effort between centers in Russia
  and the United States. The goal was to provide seismologists around the world with
  a complete set of data for the devastating earthquake. The database contains practically
  all material relevant to the 1988 Spitak earthquake and its aftereffects. It also
  includes the geological and geophysical information collected during the years prior
  to the event, important for understanding the event. Almost 2,000 files and 170
  megabytes of data are contained in the collection. This set consists of textual
  and graphical information about the earthquake, a \"DOS\" and \"Microsoft Windows\"
  menu for accessing the data, and a User Manual which discusses the data and explains
  how to use the access software to display and obtain useful information. Briefly,
  system requirements are: DOS: Requires 800 Kb hard disk space and 560 Kb memory
  Windows: Requires 570 Kb hard disk space for the access software. The database is
  static and is no longer being updated.\",\n\t\"license_title\": null,\n\t\"extras\":
